 @toadnumero47  Vocês foram beneficiados, nem adianta tentar dizer o contrário.

E dizer que se não fosse o Yuri Alberto vocês ganhariam? Vocês têm sorte que o Ganso desperdiçou uma chance clara de gol porque ele corre, Cano posicionou-se errado e o cabeceio saiu fraquinho, pênalti não marcado para o Fluminense no toque de mão do Fagner, Juiz que nem um maluco expulsando sem motivos...

Não adianta dizer que vocês amassaram só no primeiro tempo, o seu time é covarde. Espera o erro dos adversários para reagir, esse é o maior erro de vocês. Se pegam um time que não falha na saída de bola, acontece igual aconteceu no segundo tempo. Completamente destroçados, taticamente e fisicamente. Seu time não tem banco para repor as peças porque não adiantaria nada e o Fluminense só batendo. Vê se abre o olho, gayvota. Dentre os 4 grandes de SP, és um átomo.

