 @EMANUElDUARTE10  Não acredito nisso. O Cruzeiro está em queda livre. O time não consegue fazer gol. 
O Vasco e o Santos cresceram no segundo turno, enquanto o Cruzeiro caiu e muito. 
Também achava o Corinthians, mas o jogo de ontem, principalmente o primeiro tempo, mostrou que o time tem força pra permanecer.
